import React, {useEffect, useRef, useState} from 'react';


const LoginPage = ({navigation}: any) => {

  const [inLoginPage, setInLoginPage] = React.useState(false);
  const [passwordinput, setPassword] = React.useState('');
  const [emailinput, setEmailPassword] = React.useState('');

  useEffect(() => {
    setInLoginPage(false);
  }, [navigation]);

  function signupButton() {
    const logindto={
            // countryCode:Number(countryCode),
            // mobileNumber: Number(mobileinput),
            emailAddress:emailinput,
            password :passwordinput  
    }
    console.log(logindto)

  }
  function setpagination() {
    navigation.navigate('Registration');
  }
  function validation(type: any, value: any) {
    console.log();
  }
  function onChangeValue(name: any, text: string) {
    if (name == 'email') {
      setEmailPassword(text.toLowerCase())
    }
    if(name == 'password'){
      setPassword(text)
    }
  }
  const handleChange = (event: React.ChangeEvent<HTMLInputElement>): void => {
    if (event.target.name == 'email') {
        setEmailPassword(event.target.value.toLowerCase())
      }
      if(event.target.name == 'password'){
        setPassword(event.target.value)
      }
  };
  return (
    <>
    <div className="container">
      <div className="w-50">
        <form className="card p-4 mt-4" >
          <h1>Login Form Example</h1>
          <div className="mb-3">
            <label htmlFor="exampleInputEmail1" className="form-label">
              Email address
            </label>
            <input
              type="email"
              name="email"
            //   onChange={handleChange}
            //   value={emailinput}
              className="form-control"
              id="exampleInputEmail1"
              aria-describedby="emailHelp"
            />
          </div>
          <div className="mb-3">
            <label htmlFor="exampleInputPassword1" className="form-label">
              Password
            </label>
            <input
              type="password"
              name="password"
            //   value={passwordinput}
            //   onChange={handleChange}
              className="form-control"
              id="exampleInputPassword1"
            />
          </div>

          <button type="submit" className="btn btn-primary">
            Submit
          </button>
        </form>
        {/* <div className="mt-4 bg-light p-2">
          <p>{JSON.stringify(state.user)}</p>
        </div> */}
      </div>
    </div>
  </>

  );
};


export default LoginPage
